import React from 'react';
import { HeaderOne } from '../../components/Header';
import {Row, Col, Container} from 'react-bootstrap'

const adminPage = () => {
    return (
        <div>
            <HeaderOne/>

            <Container>
                <Row>
                    <Col className="sidebar" md={2}>Side bar</Col>
                    <Col md={10}>Container</Col>
                </Row>
            </Container>
            
        </div>
    );
};

export default adminPage;
